import ".././styles/GalleryPreview.css";
function GalleryPreview() {
    return(
        <div>
            <div class="section-title">
                Gallery
            </div>
            <div id="gallery-section">
                <img class="gallery-picture-preview"></img>
                <img></img>
                <img></img>
                <img></img>
                <img></img>
                <div class="view-more-gallery">
                    view more
                </div>
            </div>
        </div>
    );
}

export default GalleryPreview;
